var text1=text.replaceAll('.','all')
var text2=text1.replaceAll(',','comma')
const textwords=text2.split(" ")
const word=document.getElementById("submit")
const form=document.getElementById("form1")
const textcontainer=document.querySelector(".textcontainer")
form.addEventListener("submit",function(e){
    e.preventDefault()
    const words=Number(word.value)
    var para,i;
    for(i=0;i<words;i++){
        para=para+" "+textwords[Math.floor(Math.random()*9887)];
    }
    para=para+"."
    para=para.slice(9)
    if(words==0)
    textcontainer.innerText="Enter proper length"
    else if(words<10000)
    textcontainer.innerText=para;
    else
    textcontainer.innerText="Number of words must be less than 10000"
})

function copyexecute(){
    textcontainer.select()
    document.execCommand('copy')
    window.getSelection().removeAllRanges()
}